import React from 'react';
import './Home.css';
import AuthenticationStatus from '../auth/AuthenticationStatus';
import User from '../auth/User';
import { Link } from 'react-router-dom';
import { GeneralButton } from '../components/Buttons';
import axios from 'axios';

fetch('php/insert.php', { // URL
    body: JSON.stringify(this.state), // data you send.
    cache: 'no-cache', // *default, no-cache, reload, force-cache, only-if-cached
    headers: {
      'content-type': 'application/json'
    },
    method: 'POST', // *GET, POST, PUT, DELETE, etc.
    mode: 'cors', // no-cors, cors, *same-origin
    redirect: 'follow', // *manual, follow, error
    referrer: 'no-referrer', // *client, no-referrer
})
.then(function(response) {
    // manipulate response object
    // check status @ response.status etc.
    return response.json(); // parses json
})
.then(function(myJson) {
    // use parseed result
    console.log(myJson);
});

export const TEST = () => {
    return (
      <main>
        
        <h1>TEST POST</h1>
        <p>Authentication Status: <AuthenticationStatus /></p>
        <p>User: <User /></p>
        <Link to="/test" method='post'>
          <GeneralButton type='submit' name='action' value='HELLOPOST'>TEST POST</GeneralButton>
        </Link>

      </main>
      
    );
  };
